import React from "react";
import {
  Layout,
  Text,
} from "@ui-kitten/components";


export const CreateScreen = () => {
  return (
    <Layout style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
      <Text category="h1">Create</Text>
    </Layout>
  );
};
